ncidunt.', 'The other premiere (played by all four musicians) was contemporary composer Chen Hsin-Leis By the Light of Nature, a musical realization of the concept of nothingness or blankness, described in the notes as one of the spiritual cores of Chinese art. To give you a partial idea of that concept, imagine something that is hidden from you, like a village that you cant see because theres a mountain in front of it. This most impressive work included some apparently pre-recorded digital sounds.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'biography', NULL, '2013-06-13 20:56:34', '2013-07-22 01:29:11', '45085120-a97d-4346-9d2d-d633d94a6822');
