INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `heading`, `body`, `description`, `instruments`, `duration`, `performers`, `video`, `mediaFormat`, `year`, `emailHeading`, `emailAddress`, `socialHeading`, `facebookUrl`, `twitterUrl`, `googlePlusUrl`, `fromName`, `fromEmail`, `message`, `messageFormHeading`, `awardList`, `subHeading`, `authorName`, `authorUrl`, `workTitle`, `workUrl`, `brief`, `career`, `press`, `subject`, `allowDownload`, `linkedinUrl`, `youtubeUrl`, `vimeoUrl`, `metaKeywords`, `metaDescription`, `token`, `emailOwner`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('115', '116', 'en_us', 'Willow Catkins', NULL, NULL, '<p>\r\n	Willow catkins fly in the wind like snow dancing under sunshine. Everything is like a dream. Everything freezes at that moment. Time does not move. Forever, perhaps exists in somewhere we see and do not see.\r\n</p>', '[{\"col1\":\"violin\"},{\"col1\":\"computer music\"}]', '7:17', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Hsiang-chun Chien\"}]', '', 'audio', '1999', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-26 19:45:46', '2013-08-26 19:45:46', 'ad9c1e6a-7dfb-4acd-a58a-e0f1631af46c');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `heading`, `body`, `description`, `instruments`, `duration`, `performers`, `video`, `mediaFormat`, `year`, `emailHeading`, `emailAddress`, `socialHeading`, `facebookUrl`, `twitterUrl`, `googlePlusUrl`, `fromName`, `fromEmail`, `message`, `messageFormHeading`, `awardList`, `subHeading`, `authorName`, `authorUrl`, `workTitle`, `workUrl`, `brief`, `career`, `press`, `subject`, `allowDownload`, `linkedinUrl`, `youtubeUrl`, `vimeoUrl`, `metaKeywords`, `metaDescription`, `token`, `emailOwner`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('116', '117', 'en_us', 'Pomes Fantastiques Mvt.I', NULL, NULL, '<p>\r\n	  Mvt. 1\r\n</p>\r\n<p>\r\n	  Thirds and minor seconds establish the theme. The composer tries to express tough but still flexible, full of life force. Use pizz. to imitate heartbeats, like pulsation.\r\n</p>\r\n<p>\r\n	  Mvt. 2\r\n</p>\r\n<p>\r\n	  The overtone imitates the sound of peaceful whistle. Strength flows out of the inner heart, calmly, and steadily.\r\n</p>\r\n<p>\r\n	  Mvt. 3\r\n</p>\r\n<p>\r\n	  Under the tense atmosphere, tempt to find a way out. Step by step, become frantic and crazy. At last, escape from the cage, breath in the air from the sky.\r\n</p>', '[{\"col1\":\"violin solo\"}]', '5:30', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Chia-lun Chang\"}]', '', 'audio', '2000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-26 19:48:52', '2013-08-26 20:02:25', 'ca82530e-63d7-4d12-a2cb-dc00306a0ede');
