INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `heading`, `body`, `description`, `instruments`, `duration`, `performers`, `video`, `mediaFormat`, `year`, `emailHeading`, `emailAddress`, `socialHeading`, `facebookUrl`, `twitterUrl`, `googlePlusUrl`, `fromName`, `fromEmail`, `message`, `messageFormHeading`, `awardList`, `subHeading`, `authorName`, `authorUrl`, `workTitle`, `workUrl`, `brief`, `career`, `press`, `subject`, `allowDownload`, `linkedinUrl`, `youtubeUrl`, `vimeoUrl`, `metaKeywords`, `metaDescription`, `token`, `emailOwner`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('187', '188', 'en_us', 'The Glance', NULL, NULL, '<p>\r\n	Starts with the beginning of a pop song, \"Because of the glance of you among people, I can\'t forget your face.\" After the glance, you are stuck. Everything is already written; is destined. I was a very rational; love life was never my priority. Thus I could not understand Johannes Brahms\' love to the one woman through out life. Until I met a person, i realized that staying quietly beside Clara might have been the only thing Brahms wished for. I love this person more and more, day by day. The happier I felt; the more painful I experienced.\r\n</p>\r\n<p>\r\n	The piece describes the contrasts in between the extreme emotions, from tonal to atonal;  from purity to density; from rational to emotional. Life is a process of repeating and circulating, however, every time, it does not go back to exactly same place; it changes a little.\r\n</p>\r\n<p>\r\n	The piece ends in E major, which is a major this higher than the beginning. It contains quotation another pop song, At Least I Have You, \"I am afraid that it\'s gonna be too late, and I am going to hold you tight\", which is symbolization of sublime.\r\n</p>\r\n<p>\r\n	No matter what, I am thankful that I loved.\r\n</p>', '[{\"col1\":\"violin\"},{\"col1\":\"cello\"},{\"col1\":\"piano\"}]', '5:14', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"}]', '', 'audio', '2008', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 13:52:48', '2013-08-27 13:52:48', '01717bc3-c396-451e-b59e-c00d3173ec68');
