INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `heading`, `body`, `description`, `instruments`, `duration`, `performers`, `video`, `mediaFormat`, `year`, `emailHeading`, `emailAddress`, `socialHeading`, `facebookUrl`, `twitterUrl`, `googlePlusUrl`, `fromName`, `fromEmail`, `message`, `messageFormHeading`, `awardList`, `subHeading`, `authorName`, `authorUrl`, `workTitle`, `workUrl`, `brief`, `career`, `press`, `subject`, `allowDownload`, `linkedinUrl`, `youtubeUrl`, `vimeoUrl`, `metaKeywords`, `metaDescription`, `token`, `emailOwner`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('191', '192', 'en_us', 'Immaculate Snow', NULL, NULL, '<p>\r\n	The title in Chinese means \"the lean air and light after thunderstorm or snowstorm.\" Deeper meaning is about being calm in this material world.\r\n</p>\r\n<p>\r\n	I was inspired by the last snow in Beijing. It snowed heavily. The snow\'s crystal was very light and large, so it looks like feather. I was standing in front of a huge glass. The snow was so light so it flowed in the air sometimes up towards the sky. I felt like that I was in a glass snow ball. The snow leaned up the city and covered every noise. The world was full of tranquility.\r\n</p>', '[{\"col1\":\"string quartet\"}]', '7:23', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Can Gao and YaJing Su\"},{\"col1\":\"viola\",\"col2\":\"WenTing Kang\"},{\"col1\":\"cello\",\"col2\":\"YiChen Yang\"}]', '', 'audio', '2004', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 13:55:59', '2013-08-27 13:55:59', 'b154de59-eed4-459a-b974-bc7aa66ddc03');
