INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `heading`, `body`, `description`, `instruments`, `duration`, `performers`, `video`, `mediaFormat`, `year`, `emailHeading`, `emailAddress`, `socialHeading`, `facebookUrl`, `twitterUrl`, `googlePlusUrl`, `fromName`, `fromEmail`, `message`, `messageFormHeading`, `awardList`, `subHeading`, `authorName`, `authorUrl`, `workTitle`, `workUrl`, `brief`, `career`, `press`, `subject`, `allowDownload`, `linkedinUrl`, `youtubeUrl`, `vimeoUrl`, `metaKeywords`, `metaDescription`, `token`, `emailOwner`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('215', '216', 'en_us', 'Ebb and Flow', NULL, NULL, '<p>\r\n	Ebb and Flow is inspired by the idea of cause and effect. All things, as well as the sections of this work, start with a strike, and followed by series of effects that create different outcomes. These unpredictable results lead this work to conflict or cohesive sections that create emotional tension to propel the music forward.\r\n</p>\r\n<p>\r\n	The piece is constructed around two groups of pitches  C, C<sup>#</sup>, D, D<sup>#</sup>, E, and F<sup>#</sup>, G, G<sup>#</sup>, A, B<sup>b</sup>. They start the work together as a whole, and go apart through out the piece in variation. The sets are presented wholly or partially in forms of pillar chords, melodic components, accompanying forces, and harmonic backdrop. Furthermore, the two sets sometimes compete with each other, and sometimes combine to compliment each other.\r\n</p>\r\n<p>\r\n	F and B, the two among the twelve pitches that are not presented in the main pitch materials, play an insignificant role in the composition. They act as the filling of the twelve-tone-chord sonority, but dont draw melodic or thematic attention. It is not until the end, after all instruments reach the climax, that the vibraphone hit these two notes strongly to conclude this piece with a satisfying completion of twelve pitches.\r\n</p>', '[{\"col1\":\"orchestra\"}]', '10:09', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"orchestra\",\"col2\":\"Kiev Philoharmonics\"}]', '', 'audio', '2007', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 14:18:01', '2013-08-27 14:18:01', '9c63fb70-ace3-4ac9-a363-66672110b71b');
