INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `heading`, `body`, `description`, `instruments`, `duration`, `performers`, `video`, `mediaFormat`, `year`, `emailHeading`, `emailAddress`, `socialHeading`, `facebookUrl`, `twitterUrl`, `googlePlusUrl`, `fromName`, `fromEmail`, `message`, `messageFormHeading`, `awardList`, `subHeading`, `authorName`, `authorUrl`, `workTitle`, `workUrl`, `brief`, `career`, `press`, `subject`, `allowDownload`, `linkedinUrl`, `youtubeUrl`, `vimeoUrl`, `metaKeywords`, `metaDescription`, `token`, `emailOwner`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('227', '228', 'en_us', '\'V\' to Transformative Lightness of Beings', NULL, NULL, '<p>\r\n	 Maestro Hu, Yongyen told me, \"Hsin-Lei, give me Wagner. We want Wagner.\" And I though, \"It\'s about time to go back to German style.\"\r\n</p>\r\n<p>\r\n	 This piece is inspired by Wagner\'s Valkyrie, and quoted many leitmotivs.\r\n</p>\r\n<p>\r\n	 Wagner\'s aesthetics to war, violence, destroy and the pleasant comes afterwards are too excitingly brutal for me to accept. There is no fatherly-kind reliable and warm spirit in the opera; it\'s restless. It\'s reality. It\'s way too close to us. After being through the delicatly-processed agony and force, here comes the hope and eager for piece.\r\n</p>\r\n<p>\r\n	 Beethoven\'s motive, orchestration, phrasing and chord is the foundation of this piece. If Wagner is the deep ocean that can swallow and destroy everything, Beethoven is the broad sea that give the world life. With Beethoven\'s spirit, there is courage to floor in the waves of thunderstorm.\r\n</p>\r\n<p>\r\n	 This piece is about struggling. Struggle in between hope and desperation, against lust and desire like black hole of humanity, and yet, after everything have been through, still peruse the brightness, the reflection of sun, the light of the promise land.\r\n</p>', '[{\"col1\":\"orchestra\"}]', '19:24', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Xu, Zhi Lian\"},{\"col1\":\"orchestra\",\"col2\":\"EOS orchestra\"}]', '', 'audio', '2005', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 14:33:57', '2013-08-29 20:51:52', '839d3683-40c2-455e-936a-5c145c0359cb');
