the way he conceived of the Brandenburg Concertos), since the sources are various, as detailed below.\\r\\n<\\/p>\",\"8\":\"1000\",\"7\":[{\"col1\":\"Flute\"},{\"col1\":\"Viola\"}],\"11\":\"audio\",\"9\":\"Bach\",\"12\":[\"26\"],\"10\":\"\",\"14\":\"1980\"}}', '2013-08-02 05:47:51', '2013-08-02 05:47:51', '441ab074-2e82-4a65-8dc0-73cd84e2e7f8');
