INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('115', '117', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Poemes Fantastiques Mvt.I\",\"slug\":\"poemes-fantastiques-mvt-i\",\"postDate\":1377546532,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"3\":\"<p>\\r\\n\\tMvt. 1\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThirds and minor seconds establish the theme. The composer tries to express tough but still flexible, full of life force. Use pizz. to imitate heartbeats, like pulsation.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tMvt. 2\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe overtone imitates the sound of peaceful whistle. Strength flows out of the inner heart, calmly, and steadily.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tMvt. 3\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tUnder the tense atmosphere, tempt to find a way out. Step by step, become frantic and crazy. At last, escape from the cage, breath in the air from the sky.\\r\\n<\\/p>\",\"8\":\"5:30\",\"7\":[{\"col1\":\"violin solo\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Chia-lun Chang\"}],\"10\":\"\",\"14\":\"2000\"}}', '2013-08-26 19:48:52', '2013-08-26 19:48:52', '1c6858c9-fac3-46f5-beb0-8ee26a12fbf9');
