INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('161', '180', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Rustling Leaves\",\"slug\":\"rustling-leaves\",\"postDate\":1377554034,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"178\",\"177\"],\"41\":[\"179\"],\"3\":\"<p>\\r\\n\\tIn Rustling Leaves I am trying to depict the sound of leaves. The music is about the special experience of the great nature.  These is a mandarin term that I could not understand, which is \\u201c\\u5c71\\u6fe4\\u201d. It means \\u201cmountain waves\\u201d. Until one day, I went to a park. I was surrounded by trees. While wind was blowing, the sound of leaves was almost like ocean\\u2019s waves. For a moment, I thought that I am by the beach. The only difference was that the \\u201cwaves\\u201d actually go thought my body. I felt like that I am floating in the air with the ebb and flow. Up and down, up and down\\u2026\\r\\n<\\/p>\",\"8\":\"9:42\",\"7\":[{\"col1\":\"violin\"},{\"col1\":\"viola\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Nick Naegele\"},{\"col1\":\"viola\",\"col2\":\"Momchil Monchev\"}],\"10\":\"\",\"14\":\"1998\"}}', '2013-08-26 21:53:54', '2013-08-26 21:53:54', 'a7404f5b-8050-4e4d-9284-bb048df92ea9');
