INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('169', '192', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Immaculate Snow\",\"slug\":\"immaculate-snow\",\"postDate\":1377611759,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"189\",\"190\"],\"41\":[\"191\"],\"3\":\"<p>\\r\\n\\tThe title in Chinese means \\\"the lean air and light after thunderstorm or snowstorm.\\\" Deeper meaning is about being calm in this material world.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI was inspired by the last snow in Beijing. It snowed heavily. The snow\'s crystal was very light and large, so it looks like feather. I was standing in front of a huge glass. The snow was so light so it flowed in the air sometimes up towards the sky. I felt like that I was in a glass snow ball. The snow leaned up the city and covered every noise. The world was full of tranquility.\\r\\n<\\/p>\",\"8\":\"7:23\",\"7\":[{\"col1\":\"string quartet\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Can Gao and YaJing Su\"},{\"col1\":\"viola\",\"col2\":\"WenTing Kang\"},{\"col1\":\"cello\",\"col2\":\"YiChen Yang\"}],\"10\":\"\",\"14\":\"2004\"}}', '2013-08-27 13:55:59', '2013-08-27 13:55:59', 'b635cb9a-4d87-42dd-8e07-0d7ea98eea75');
