INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('177', '208', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Ink Painting\",\"slug\":\"ink-painting\",\"postDate\":1377612622,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"205\",\"206\"],\"41\":[\"207\"],\"3\":\"<p>\\r\\n\\tEach single instrument of the quartet represents a basic nature element. first violin is the fire of war (fire), second violin is the wind in forest (wind), viola is the deep ocean (water), and cello is the shifting sands of desert (earth).\\r\\n<\\/p>\",\"8\":\"14:32\",\"7\":[{\"col1\":\"string quartet\"},{\"col1\":\"orchestra\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Mark Gibson\"},{\"col1\":\"violin\",\"col2\":\"Gao Can and Kuan Chang Tu\"},{\"col1\":\"viola\",\"col2\":\"Yan-ting Wu\"},{\"col1\":\"cello\",\"col2\":\"Chang Pan\"}],\"10\":\"\",\"14\":\"2011\"}}', '2013-08-27 14:10:23', '2013-08-27 14:10:23', '4bb6a5f1-d671-4a04-8da3-cea159f91657');
