INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('181', '216', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Ebb and Flow\",\"slug\":\"ebb-and-flow\",\"postDate\":1377613081,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"213\",\"214\"],\"41\":[\"215\"],\"3\":\"<p>\\r\\n\\tEbb and Flow is inspired by the idea of cause and effect. All things, as well as the sections of this work, start with a strike, and followed by series of effects that create different outcomes. These unpredictable results lead this work to conflict or cohesive sections that create emotional tension to propel the music forward.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe piece is constructed around two groups of pitches \\u2013 C, C<sup>#<\\/sup>, D, D<sup>#<\\/sup>, E, and F<sup>#<\\/sup>, G, G<sup>#<\\/sup>, A, B<sup>b<\\/sup>. They start the work together as a whole, and go apart through out the piece in variation. The sets are presented wholly or partially in forms of pillar chords, melodic components, accompanying forces, and harmonic backdrop. Furthermore, the two sets sometimes compete with each other, and sometimes combine to compliment each other.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tF and B, the two among the twelve pitches that are not presented in the main pitch materials, play an insignificant role in the composition. They act as the filling of the twelve-tone-chord sonority, but don\\u2019t draw melodic or thematic attention. It is not until the end, after all instruments reach the climax, that the vibraphone hit these two notes strongly to conclude this piece with a satisfying completion of twelve pitches.\\r\\n<\\/p>\",\"8\":\"10:09\",\"7\":[{\"col1\":\"orchestra\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"orchestra\",\"col2\":\"Kiev Philoharmonics\"}],\"10\":\"\",\"14\":\"2007\"}}', '2013-08-27 14:18:01', '2013-08-27 14:18:01', '09eeef22-cf96-4806-90c8-932423f3c9ce');
