INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('216', 'field', '3', 'en_us', ' ebb and flow is inspired by the idea of cause and effect all things as well as the sections of this work start with a strike and followed by series of effects that create different outcomes these unpredictable results lead this work to conflict or cohesive sections that create emotional tension to propel the music forward the piece is constructed around two groups of pitches c c d d e and f g g a bb they start the work together as a whole and go apart through out the piece in variation the sets are presented wholly or partially in forms of pillar chords melodic components accompanying forces and harmonic backdrop furthermore the two sets sometimes compete with each other and sometimes combine to compliment each other f and b the two among the twelve pitches that are not presented in the main pitch materials play an insignificant role in the composition they act as the filling of the twelve tone chord sonority but don t draw melodic or thematic attention it is not until the end after all instruments reach the climax that the vibraphone hit these two notes strongly to conclude this piece with a satisfying completion of twelve pitches ');
